window.bookSummaryJSON = "<p><b>She needs to break away from the past. He just wants to keep his head down. Opposites attract in this spicy age-gap romance at an adults-only nudist resort.</b><br> <br> Grief can do crazy things to a woman. And I've found a new family with three fellow widows. Now, we're shaking off our old lives at a naughty resort where clothes are forbidden, and anything goes.<br> <br> Then I see <i>him</i>. Ryan Kimble, the sexy general manager at Au Naturel Naturist Resort South Seas. So what if he's nine years younger than I am? I'm craving a fling. And he has a killer body…<br> <br> But nothing is ever as simple as it seems.<br> <br> <b><i>Natural Temptation</i></b><b> is the third book in the Au Naturel Nights series of contemporary romance.</b></p>"; 
